import React, { useEffect } from "react";
import './Graph.css';
import '../../jquery-loader';
import ReactFlot from "react-flot";
import '../../../node_modules/react-flot/flot/jquery.flot.time.min';

function Graph(props) {

    console.log(props)

    const data = [{
        label: "chart",
        data: [[0, 3], [4, 8], [8, 5], [9, 13]],
        // color: "red",
        series: {
            lines: { show: true, fill: true, fillColor: "rgba(255, 255, 255, 0.8)" },
            tickSize: [2, 'hour']
        }
    }];

    const options = {
        xaxis: {
            min: 0, 
            max: 24, 
            mode: "time", 
            timeformat: "%H:%M"}, 
        yaxis: {min: 0, max: 9},
        series: {
            lines: { show: true },
            points: { show: true }
        },
        markings: [
            { 
            yaxis: { from: 0, to: 54 }, 
            color: "#D40702" }, 
        ]
    }

    return (
        <ReactFlot id="product-chart" data={data} options={options} width="100%" height="250px" />
      );

}

export default Graph;
